text:
Vor andern hab ich offt, und zwar nicht sonder frucht,
                                       Ein unbekanntes werck voll mahlerey durchsucht,
                                       In welchem, wie man meynt, was ieder fürst getrieben,
                                       Der diesen thron besaß, durch zeichen auffgeschrieben;
                                       Wie lange dieses reich werd in der blüthe stehn;


Wie künfftig ieder printz werd auf und untergehn.

Uns jammert seine stärcke;
                                       Doch unser geist entgrimmt, dafern wir seine wercke
                                       Nur überhin besehn!

Bedenck auch, was es sey, vor so viel tausend sorgen
                                       Stets als gefangen gehn, wenn der bestürtzte morgen
                                       Die angst der welt entdeckt, anhören, was das schwerdt
                                       Der Persen niederwirfft; wohin der Scyten pferd
                                       Den schnellen fuß einsetzt; was Susa vorgenommen;
                                       Wie weit der barbar sey; wie weit der Gothe kommen;
                                       Itzt dass der Hunnen grimm schon durch den Ister setzt,
                                       Dass Cypern frembde sey, dass Asien verletzt,
                                       Dass Colchus neue ränck und Pontus list ersinne;
                                       Bald, dass der stoltze Franck in Griechenland gewinne;
                                       Dass Taurus nicht mehr treu.

Ich hub ihn auf den thron, als Michael geschlagen;
                                       Ich zwang ihn, dass er sich must in den anschlag wagen;
                                       Und bin ich nicht mehr der, der Ich vor diesem war?

Wahr ists, dass Michael wohl reden nie gelehrt;
                                       Wahr ists, dass ich mich auch zu heucheln nie beflissen;
                                       Doch was dir meine faust genützt, wird dein gewissen
                                       Entdecken, ob ich schweig.

Ich wil für euch im stahl beym schwartzen Pontus stehn,
                                       Ich wil biss auf den fall mit Scyth und Parthe kämpffen;
                                       Ich wil der Bulgar trutz mit diesem blute dämpffen.

er wünscht, nicht dass man mindre
                                       Der langen marter grimm, dass man die schmertzen lindre;
                                       Er wünscht vor so viel dienst nur eine kurtze zeit.

Wir steigen als ein rauch, der in der lufft verschwindet;
                                       Wir steigen nach dem fall, und wer die höhe findet,
                                       Findt, was ihn stürtzen kan.

nichts ist, das nicht noch heute
                                       Könt in eil zu drümmern gehn;
                                       Und wir!

Ihn wirfft die sanffte nacht
                                       Auf ein geringes stroh, biss Titan ist erwacht;
                                       Wir irren ohne ruh.

Es sey nun, wie es sey; er ist nicht als er pflag;
                                       Ihm liegt was auf der brust; er wünscht nur nach dem tag
                                       Und fleucht das sanffte bett!

Wo du dem, welcher dir die knie geneiget,
                                       Offt in gestalt der schlangen dich gezeiget;
                                       Wo dir geliebt, in ungeheuren hecken
                                       Durch zeichen, durch gesicht, durch licht uns zu erschrecken;
                                       Wo deine lust, die lüffte zu bewegen,
                                       Mit blitz und donnerschlägen,
                                       Wo deine krafft sich findt in unterirrd'schen klüfften,
                                       In kalter leichen grüfften;
                                       Wo die verborgnen schätze
                                       Sind unter deiner hut;
                                       Wo nichts, das dich ergetze,
                                       Geht über menschen blut;
                                       Wo du mit toller brunst die sinnen kanst entzünden
                                       Und ware lieb auffbinden,
                                       Wo du in nympffen dich und nixen offt verstellet
                                       Und dich zu frau und mann gesellet;
                                       Wo du die frau dem mann und dieser den verschlossen,
                                       Dass sie keiner eh genossen;
                                       Wo du durch brüder hand die brüder hast getödtet
                                       Und den unschamhafften sohn durch der eltern blut errötet;
                                       Wo du, was künfftig offt erklärt,
                                       In einer jungfraun eingeweide,
                                       Die durch des eignen vaters schwerdt
                                       Geopffert in der wüsten heide;
                                       Wo eines knaben abgehauen haupt


                                             10


                                       Durch dich, was man nicht wust, entdecket;
                                       Wofern ein kind, das von der brust geraubt,
                                       Mit nutz dir an den pfahl gestecket;
                                       Wo einer schwangern leib noch lebend auffgeschnitten,
                                       Um dir genung zu thun, um dich zu überbitten;
                                       Wo eine mutter selbst, was sie gebahr, verzehrt,


Als du dich günstig hast zu ihr gekehrt;
                                       Wo ich dein priester bin, der niemals unterließ
                                       Mit solchen opffern dich zu ehren;
                                       Wo ich der frauen hertz warm aus den brüsten rieß:
                                       So lass mich gnädig antwort hören!

Das dunckel deckt die gassen;
                                       Die priester pflegt man stracks ohn einred einzulassen;
                                       Des tempels weiter raum versichert vor gefahr,
                                       Biss dass der fürst erscheint; denn werfft ihn auf die bahr!

Wir irrten sonder licht,
Verbannt in schwartze nacht durch gottes ernstes fluchen;
Drum will der segensheld uns in dem finstern suchen.
